import React from 'react';
const mapDispatchToProps = (dispatch) => ({
    setId: (id) => dispatch(actions.setId(id)),
    setTasks: (tasks) => dispatch(actions.setTasks(tasks))
})
export default function TableDynamic() {
 function getAllData(){
    fetch("http://localhost:3001/getUser", {
        method: "get",
        headers: { "Content-Type": "application/json" },
    })
        .then(res => res.json())
        .then((data) => {
            setId(data.user._id);
            localStorage.setItem('user','Bearer '+data.token)
            history.push('/tasks');
        })
        .catch(err => console.log(err))
  }  
    return (
        <>
        <br/>
        <button type="button" class="btn btn-outline-primary" onClick={getAllData}>Click me</button>
        </>
    )
}
